import React from "react";
import {
  YMaps,
  Map,
  Placemark,
  GeolocationControl,
  RouteButton,
  SearchControl,
  TrafficControl,
  ZoomControl,
  withYMaps,
  Balloon,
  RouteEditor,
  Polyline,
  RoutePanel,
  Marker,
} from "react-yandex-maps";

function MapComponent() {
  return (
    <div>
      <YMaps query={{ apikey: "f3c78576-996b-4eaa-84f8-12a8520d276a" }}>
        <Map />
      </YMaps>
    </div>
  );
}
export default MapComponent;
